import React, {Component} from 'react'
import './style.css'

class Navbar extends Component {
    constructor() {
        super()
        this.state = {
           bg:"black",
           email:"black",
           machine:"black"
        }
    }
    changeTextColor=()=>{
        this.setState({
            bg:"purple"
        })
    }


    render(){
        return (
            <div id ='navbar'>
                <img className="header" src={"./CertifiedAtmsLogo.png"} alt="Certified Atms Logo"/>
                <span className="tabs" id="home" onClick={() => this.props.changeComponent('Home')} >Home |</span>
                <span className="tabs" id="email" onClick={() => this.props.changeComponent('Email')}>Email |</span>
                <span className="tabs" id="machine" onClick={() => this.props.changeComponent("Machine")} >Machines |</span>
            </div>
        )
    }
}



export default Navbar;
